//checked
Game.prototype.sleep = function(ms) {
  return new Promise(resolve => setTimeout(resolve, ms));
}

//chcked
Game.prototype.bindEvents = function () {

  var that = this
  var cells = document.getElementsByClassName('cell')

  Array.prototype.forEach.call(cells, function (target) {
            // clicking on a cell and revealing cell
            target.addEventListener('click', function (evt) {
              target.reveal()
              that.game()

            })



            // marking a cell as a bomb
            target.addEventListener('contextmenu', function (evt) {
              var emoji
              evt.preventDefault()

              if (target.isFlagged) {
                target.setAttribute('aria-label','Field')
                emoji = that.emojiset[3].cloneNode()
                target.isFlagged = false
              } else {
                target.setAttribute('aria-label', 'Flagged')
                emoji = that.emojiset[2].cloneNode()
                target.isFlagged = true

              }
              target.childNodes[0].remove()
              target.appendChild(emoji)
            })

  })

  window.addEventListener('click', function (evt) {

      that.showMessage()

      that.sleep(2000).then( ()=>{
         that.restart()

      })





  })


}

Game.prototype.game = function () {
  if (this.result) return
    this.result = true
    this.showMessage()
  }




Game.prototype.restart = function () {
  clearInterval(this.timer)
  this.emojiset = this.randchar()
  this.result = false
  this.timer = false
  this.init()
  this.startTimer()


}

//chekced
Game.prototype.resetMetadata = function () {
  document.getElementById('timer').textContent = '0.00'
  document.querySelector('.js-settings').innerHTML =  '🔧'
}

